import React, { useState, useEffect, useCallback } from "react";
import axios from "axios";

const VideoPage = ({ match }) => {
  console.log("video params", match.params.videoId);

  const getVideo = () => {
    const baseURL = "https://www.googleapis.com/youtube/v3/search";
    const part = "&part=snippet%2CcontentDetails%2Cstatistics";
    const id = `&id=${match.params.videoId}`;
    const key = `&key=${process.env.REACT_APP_YOUTUBE_API_KEY}`;
    const url = `${baseURL}${part}${id}${key}`;

    axios
      .get(url, {
        headers: {
          "Access-Control-Allow-Credentials": true,
          // "Access-Control-Allow-Origin": "*"
          //   "Access-Control-Allow-Credentials": true,
          //   "Access-Control-Allow-Origin": "*",
          //   "Access-Control-Allow-Methods": "GET",
          //   "Access-Control-Allow-Headers": "application/json",
          //   'Content-Type': 'application/json',
          //         "Accept": 'application/json',
        },
        // contentType: 'application/json',
        // mode: 'cors',
      })
      .then((response) => {
        console.log("response", response);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  useEffect(() => {
    getVideo();
  }, []);

  return (
    <div>
      VideoPage
      'https://youtube.googleapis.com/youtube/v3/videos?part=snippet%2CcontentDetails%2Cstatistics&id=Ks-_Mh1QhMc&key=[YOUR_API_KEY]'
    </div>
  );
};

export default VideoPage;
